import React from 'react';
import { makeStyles, useTheme } from '@material-ui/core/styles';
import Typography from '@material-ui/core/Typography';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';
import { OrgRecAction } from '../statemt/actions';
import { connect } from 'react-redux';

const useStyles = makeStyles((theme) => ({
    root: {
        display: 'flex',
    },
    layout: {
        width: 'auto',
        marginTop: theme.spacing(3),
        marginLeft: 100,
        marginRight: theme.spacing(3),
    },
    toolbar: {
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'flex-end',
        padding: theme.spacing(0, 1),
        // necessary for content to be below app bar
        ...theme.mixins.toolbar,
    },
    content: {
        flexGrow: 1,
        padding: theme.spacing(3),
    },
    pos: {
        marginBottom: 12,
    },
}));

const mapStateToProps = state => ({
    ...state
});

const mapDispatchToProps = dispatch => ({
    OrgRecAction: (id,payload) => dispatch(OrgRecAction(id,payload))
});

function Home(props){
    const classes = useStyles();
    console.log(this.props.url);

    return (
        <div>
            <main className={classes.layout}>
                <div className={classes.toolbar} />
                <Card className={classes.root}>
                    <CardContent>
                        <Typography variant="h5" component="h2" align="center">
                            Lead your organization to success, signup and change the way you support your users.
                        </Typography>
                        <Typography paragraph>
                            Heat oil in a (14- to 16-inch) paella pan or a large, deep skillet over medium-high
                            heat. Add chicken, shrimp and chorizo, and cook, stirring occasionally until lightly
                            browned, 6 to 8 minutes. Transfer shrimp to a large plate and set aside, leaving chicken
                            and chorizo in the pan. Add piment√≥n, bay leaves, garlic, tomatoes, onion, salt and
                            pepper, and cook, stirring often until thickened and fragrant, about 10 minutes. Add
                            saffron broth and remaining 4 1/2 cups chicken broth; bring to a boil.
                        </Typography>
                        <CardActions>
                            <Button size="small" href={'/reg'}>Signup</Button>
                        </CardActions>
                    </CardContent>
                </Card>
            </main>
        </div>
    );
}

export default connect(mapStateToProps,mapDispatchToProps)(Home);
